import React from 'react';
import axios from 'axios';

class Photos extends React.Component{
    constructor(props){
        super(props)

        this.state = {
            photos : []
        }
    }

    componentDidMount(){
        axios.get('https://jsonplaceholder.typicode.com/photos')
        .then((response)=>{
            this.setState({
                photos : response.data.slice(0,10)
            })
        })
    }
    render(){
        let {photos} = this.state 
        let photoList = photos.map((photo)=>{
            return(
                <div class="card blue-grey darken-1" key = {photo.id}>
                    <div class="card-content white-text">
                    <span class="card-title">{photo.title}</span>
                    <img src = {photo.thumbnailUrl} alt ={photo.thumbnailUrl}/>
                    </div>
                </div>
            )
        })
        return(
            <div className = "container">
                    <h1 className = "center">Photos</h1>
                    {photoList}
            </div>

        )
    }
}

export default Photos
